import React, {useState} from 'react'
import './App.css';

const Dish = (props) => {

  return (
    <div>
      {props.name}
    </div>
  );

}

const App = () => {
  const [dish, setDish] = useState([
    {name: 'injera'},
    {name: 'Akara'},
    {name: 'Bandeja Paisa'},
    {name: 'Tandoori Chicken'}
  ])

  return (
    <div className="App">
      {/*eslint-disable-next-line array-callback-return*/}
      {dish.map((dish, index) => {
        <Dish key={index} dish={dish} />
      })}
    </div>
  );
}

export default App;
